INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, "2030/12/17 14:59:59", 1, "あたしだって\nやるときはやるよ！", 0, 0.0, "2020/04/30 12:00:00", 0.0, 24, 1, 102601, "リン", 10040, 24001);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, "2030/12/17 14:59:59", 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, 0.0, "2020/04/30 12:00:00", 0.0, 24, 1, 102601, "リン", 10040, 24002);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, "2030/12/17 14:59:59", 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 2, 0.0, "2020/04/30 12:00:00", 0.0, 24, 1, 102601, "リン", 10040, 24003);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, "2030/12/17 14:59:59", 2, "やったね！\nこれでようやく\nサボれるよ…", 3, 0.0, "2020/04/30 12:00:00", 0.0, 24, 2, 102601, "リン", 10040, 24004);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, "2030/12/17 14:59:59", 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 4, 0.0, "2020/04/30 12:00:00", 0.0, 24, 1, 102601, "リン", 10040, 24005);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, "2030/12/17 14:59:59", 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 5, 0.0, "2020/04/30 12:00:00", 0.0, 24, 2, 102601, "リン", 10040, 24006);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, "2030/12/17 14:59:59", 2, "あたしも意外と\nやるもんでしょ？", 6, 0.0, "2020/04/30 12:00:00", 0.0, 24, 2, 102601, "リン", 10040, 24007);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, "2030/12/17 14:59:59", 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 7, 0.0, "2020/04/30 12:00:00", 0.0, 24, 4, 102601, "リン", 10040, 24008);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, "2030/12/17 14:59:59", 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 8, 0.0, "2020/04/30 12:00:00", 0.0, 24, 4, 102601, "リン", 10040, 24009);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, "2030/12/17 14:59:59", 4, "まじめに\nやったんだけどな…\n悔しいな～", 9, 0.0, "2020/04/30 12:00:00", 0.0, 24, 4, 102601, "リン", 10040, 24010);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, "2030/12/17 14:59:59", 4, "やられた…\nねずみって意外と\nてごわいね", 10, 0.0, "2020/04/30 12:00:00", 0.0, 24, 4, 102601, "リン", 10040, 24011);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, "2030/12/17 14:59:59", 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 11, 0.0, "2020/04/30 12:00:00", 0.0, 24, 4, 102601, "リン", 10040, 24012);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, "2030/12/17 14:59:59", 4, "疲れた…\nけど、次こそは\n守り抜くよ…", 12, 1.81, "2020/04/30 12:00:00", 0.0, 24, 1, 102601, "リン", 10040, 24013);
